import './Intro.css';
import ContactButton from "../ContactButton/contact";


const Introduction=()=>{
    return(
        <Fragment>
            <div  className="Main_page">
            <div className="Intro">
            <h1 className="line_1">Hey,I'm Priyansh</h1>
            <h3  className="line_2">FrontEnd Webdeveloper</h3>
            <p className="line_3">UI/UX , Interactive Interface</p>
            <p className="line_4">and Responsive design......</p>
            <button className="contact_bt" id="contact" onClick={clicked}>Contact_Me_</button>
            </div>
            </div>
        </Fragment>
    )
}

export default Introduction;
